import React from "react";
const ButtonGroup = ({ children }) => {
  const text = children.props.children + "?";
  const cloneElement = React.cloneElement(children, {
    color: "red",
    customClass: "group",
  },text);
  return (
    <>
      <div>{cloneElement}</div>
    </>
  );
};
export default ButtonGroup;
